import { renderChart } from "./chart.js";
import { getReadings, groupByDay, sortByTime } from "./reading";

async function main() {
  const readings = await getReadings();
  renderChart(sortByTime(groupByDay(readings)).slice(-30));
}
main();

function Person(name, age) {
  // Please supplement the code here
  var name, age;
  this.name = name;
  this.age = age;

  var Person = new Person("Tester", 10);
}
//new Person("Tester", 10); // create object
//Person("Tester", 10); // create object

console.log(Person);
